import React from "react";
import "./app.css";
import Cards from "./page/Cards";
import { BrowserRouter, Route, Routes } from "react-router-dom";

const App = () => {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Cards />} />
      </Routes>
    </BrowserRouter>
  );
};

export default App;
